              name: $scope.modal.name,
              year: $scope.modal.year,
              season: $scope.modal.season,
              series: $scope.modal.series,
              datetime: $scope.modal.datetimeNow,
              genre: $scope.modal.genre,
              rating: $scope.modal.rating
